import React, { Component } from 'react';
import './Background.css';

class Background extends Component {
   
    render() { 
        return ( 
            <>
            <div id="Clouds">
                <div class="Cloud Foreground"></div>
                <div class="Cloud Background"></div>
                <div class="Cloud Foreground"></div>
                <div class="Cloud Background"></div>
                <div class="Cloud Foreground"></div>
                <div class="Cloud Background"></div>
                <div class="Cloud Foreground"></div>
                <div class="Cloud Background"></div>
                <div class="Cloud Background"></div>
                <div class="Cloud Background"></div>
                </div>

            </>
         );
    }
}
 
export default Background;
